import NavbarComponent from "../components/Navbar";
import SidebarComponent from "../components/Sidebar";


const UsersPage = () => {
    //data
    const data = [
        {
            "name": "user1",
            "mobile no": "0000000000",
            "age": "22",
            "gender": "male"
        },
        {
            "name": "user1",
            "mobile no": "1111111111",
            "age": "30",
            "gender": "male"
        },
        {
            "name": "user3",
            "mobile no": "2222222222",
            "age": "19",
            "gender": "female"
        }
    ];

    return (
        <>
            <NavbarComponent />
            <SidebarComponent now={'users'} />
            <div className="w-10/12 h-screen fixed p-3 mt-16 ml-80">
                <div className="w-full h-screen bg-gray-200 rounded-lg px-5 py-5">
                    <h1 className="text-3xl font-bold text-center">Users</h1>
                    {/* // */}
                    <div className="w-full">
                        <table className="table-fu border-collapse border border-gray-400">
                            <thead>
                                <tr>
                                    {Object.keys(data[0]).map((key) => (
                                        <th key={key} className="border border-gray-300 px-4 py-2 bg-gray-200">
                                            {key}
                                        </th>
                                    ))}
                                </tr>
                            </thead>
                            <tbody>
                                {data.map((item, index) => (
                                    <tr key={index}>
                                        {Object.values(item).map((value, subIndex) => (
                                            <td key={subIndex} className="border border-gray-300 px-4 py-2">
                                                {value}
                                            </td>
                                        ))}
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                    {/* // */}
                </div>
            </div>
        </>
    );
}

export default UsersPage;
